import { TiArrowLeftThick } from "react-icons/ti";
import cardfloat from "../content/SideB/stylecomponents/cardback.png"
import { Link } from "react-router-dom";
export default function Pageclient(){
    return(
        <div className=" w-full h-screen flex justify-center items-center">
            <Link to="/">
                <TiArrowLeftThick className=" fixed left-0 text-white text-5xl cursor-pointer ml-5"/>
            </Link>

            <div className="w-full flex justify-center items-center flex-col">

                <h1 className="text-white font-game text-4xl">PROJETOS</h1>

                <div className="w-full h-full flex justify-center items-center">
                    <div className='relative h-96 lg:h-fit flex justify-center items-start'>
                        <img src={cardfloat} alt="cardART" className='rounded-2xl shadow-sm shadow-purple-700 h-auto w-52  lg:w-60 '/>
                    </div>
                </div>
            </div>
        </div>
    )
}
